import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { handleSuccess } from '../utils';
import './styles/MentorDashboard.css';

function MentorDashboard() {
  const [mentor, setMentor] = useState({});
  const [loggedInUser, setLoggedInUser] = useState('');
  const [isProfileOpen, setIsProfileOpen] = useState(false); // State to toggle profile info visibility
  const navigate = useNavigate();

  useEffect(() => {
    const fetchMentorDetails = async () => {
      try {
        const response = await axios.get('http://localhost:8080/api/mentor/details');
        setMentor(response.data.mentor);
      } catch (error) {
        console.error('Error fetching mentor details:', error);
      }
    };
    fetchMentorDetails();
    
    setLoggedInUser(localStorage.getItem('loggedInUser'));
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('loggedInUser');
    handleSuccess('User Logged out');
    setTimeout(() => {
      navigate('/');
    }, 1000);
  };

  const toggleProfileInfo = () => {
    setIsProfileOpen(!isProfileOpen); // Toggle profile info visibility
  };

  return (
    <div className="mentor-dashboard">
      <div className="db-image"></div>
      <div className="welcome-banner">
        <h2 style={{ color: "#262d41" }}>Welcome, {mentor.name || 'Mentor'}!</h2>
        <p>Total Points: <strong>{mentor.marks || 0}</strong></p>
        
        {/* Profile Icon and Logout Button Container */}
        <div className="header-buttons">
          <button className="logout-button" onClick={handleLogout}>
            Logout
          </button>

          <div className="profile-icon">
            <img
              src="https://t4.ftcdn.net/jpg/08/19/66/31/360_F_819663119_che4sZSrmQv8uQJOzuN9TVQFQNHJlfQ2.jpg"
              alt="Profile Icon"
              onClick={toggleProfileInfo} // Toggle profile info visibility on click
            />
            {isProfileOpen && (
              <div className="profile-info">
                <p className="profile-detail">Name: {mentor.name || 'Mentor'}</p>
                <p className="profile-detail">Role: {loggedInUser ? 'Mentor' : 'Guest'}</p>
              </div>
            )}
          </div>
        </div>
      </div>

      <div className="button-group">
        <div 
          className="dashboard-button" 
          onClick={() => navigate('/mentor/upload')}
        >
          <img src="https://thumbs.dreamstime.com/b/file-upload-glyphs-icon-file-upload-glyphs-icon-elements-mobile-concept-web-apps-thin-line-icons-website-design-104430672.jpg" alt="Upload File" />
          <span>File Upload</span>
        </div>
        <div 
          className="dashboard-button" 
          onClick={() => navigate('/mentor/view-files')}
        >
          <img src="https://cdn-icons-png.flaticon.com/256/72/72647.png" alt="View Files" />
          <span>Uploaded Files</span>
        </div>

        <div 
          className="dashboard-button" 
          onClick={() => navigate('/mentor/view-students')}
        >
          <img src="https://www.shutterstock.com/image-vector/evaluation-criteria-icon-line-vector-600nw-2445089389.jpg" alt="View Students" />
          <span>Reference Sheet</span>
        </div>
      </div>

      {/* Scrollable list of students */}
      <div className="student-list">
        {/* Iterate through students and display them */}
        {/* Assuming you have a list of students */}
        {/* For example, this could be fetched from the backend */}
        {/* Replace the sample list with actual data */}
        <div className="student-item">Student 1</div>
        <div className="student-item">Student 2</div>
        <div className="student-item">Student 3</div>
        {/* Add more students here */}
      </div>
    </div>
  );
}

export default MentorDashboard;
